    let id = '',
        pw = '';

    return (
        <div id="login-wrapper">
            <div id="login-header">
                <p id="login-header-p">Login</p>
            </div>        
            <div id="login-body">
                <p id="login-body-id-p">ID</p>
                <input type="text" value={id}/>    
                <p id="login-body-pw-p">Password</p>
                <input type="password" value={password}/>    
            </div>    
        </div>

    );
}

export default Login;
